import React from "react";
import iframe from 'react-iframe';

import Header from "../Header/Header";
import ItemList from "./ItemList";
import ProjectList from "./ProjectList";
import KaneLogo from "../KaneLogo/KaneLogo";
import ResourceList from "./ResourceList";

import Resume from "./Docs/Resume";Bachelors.jsx
import Bachelors from "./Docs/Bachelors";
import Masters from "./Docs/Masters";
import GACert from "./Docs/GACert";



import Blocks from "./UploadPhotosToWeb/docs/blocks.png";
import GrandCanyon from "./UploadPhotosToWeb/docs/grandCanyon.png";
import Desert from "./UploadPhotosToWeb/docs/desert.png";
import Obsessions from "./UploadPhotosToWeb/docs/obsessions.png";
import TeamWork from "./UploadPhotosToWeb/docs/teamWork.png";



const MainPage = () => {


    return (
        <div>
            <Header />
            {/* <iframe width="560" height="315" src="https://www.youtube.com/embed/X4t0JxiBeO0" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe> */}
            {/* <ItemList/> */}
            {/* {findAmp()} */}
            <div className="background-stripes red-stripe" ></div>
            <div className="background-stripes red-stripe"></div>
            <div className="background-stripes red-stripe"></div>
            <KaneLogo/>
            <div className="redbox">
                <img src={Blocks} alt="" id="blocksImg" className="thematicImg"/>
            </div>

            {/* <ResourceList/> */}
            <div className="redbox">
                <img src={GrandCanyon} alt="" id="grandCanyonImg" className="thematicImg"/>
            </div>
            <div className="redbox">
                <img src={Desert} alt="" id="desertImg" className="thematicImg"/>
            </div>

            <ProjectList/>
            <div className="redbox">
                <img src={TeamWork} alt="" id="teamWorkImg" className="thematicImg"/>
            </div>
            <div className="redbox">
                <img src={Obsessions} alt="" id="obessionsImg" className="thematicImg"/>
            </div>

        </div>
    )
}

export default MainPage;
